/* 保险到期 */
$('#J_insure_expire_year').change(function(){
    var selected = $(this).val();
    if( selected==0 || selected==-1 ){
        $("#J_insure_expire_month option[value='0']").attr('selected', 'true');
        $('#J_insure_expire_month').css('display', 'none');
    }else{
        $('#J_insure_expire_month').css('display', '');
    }
});


/* 全选 */
function chkAll(o, name){
    var chklist = document.getElementsByName(name);
    for(var i = 0; i < chklist.length; i++){
        chklist[i].checked = o.checked ? true : false;
    }
}


/* 选取.颜色 */
$('.J_select_color').click(function(){
    $('.J_select_color').css('border', '1px solid #aaa');
    $(this).css('border', '1px solid red');
    $('#J_color').val($(this).attr('data-num'));
});


/* 选取.年份.年检到期、交强险到期、商业险到期 */
$('#J_asexpire_select_year,#J_trafficexpire_select_year,#J_businessexpire_select_year').change(function(){
    var year = $(this).children('option:selected').val();
    var type = $(this).attr('data-type');
    if( year==0 ){
        $('#J_'+type+'_select_month').css('display', 'none');
        $('#J_'+type).val(0);
    }else if( year==1 ){
        $('#J_'+type+'_select_month').css('display', 'none');
        $('#J_'+type).val(1);   // 年检到期-未检、交强险到期-过保、商业险到期-无商业险
    }else{
        var month = $('#J_'+type+'_select_month option:selected').val();
        $('#J_'+type+'_select_month').css('display', '');
        $('#J_'+type).val(year+'-'+month);
    }
});



