/* 选取.品牌 */
$('#J_select_parent_brand a').live('click', function(){
    var pnum = $(this).attr('data-pnum');
    $('#J_select_parent_brand a').removeClass('selected');
    $(this).addClass('selected');
    $('.J_select_sub_brand').css('display', 'none');
    $('#J_select_sub_brand_'+pnum).css('display', '');
    $('#J_select_sub_title').html( $(this).attr('title')+'　车系' );
});



/* 选取.车系 */
$('.J_select_sub_brand a').live('click', function(){
    var snum = $(this).attr('data-snum');
    var fullName = $(this).attr('data-pname') + ' - ' + $(this).html();
    $('#J_brand_num').val(snum);
    $('#J_brand_name').val(fullName);
    art.dialog({id:'J_brand_window'}).close();
});